import React, { useState } from "react";
import "./style/SalesDashboard.css";
import { AiOutlineDown } from 'react-icons/ai';
import { BsThreeDots } from 'react-icons/bs';




export default function SalesDashboard() {
//     const [show, setShow] = useState(false);
// const handleClick = (e) => {
//     setShow(!show);
// };
    return (
        <>

            <div className="Salesdashboard">
                <div className="Salesdashboard_1">
                    <div className="Salesdashboard_1_title">
                        <AiOutlineDown />
                        <label>TODO</label>
                    </div>
                    <div className="Salesdashboard_1_items">
                        <div className="Salesdashboard_1_items_list" ></div>
                        {/* onClick={(e) => {
                            handleClick(e);
                        }} */}

                        {/* >

                        </div> */}
                        <AiOutlineDown />
                        <label>Task names</label>
                        <BsThreeDots />
                    </div>
                    {/* {show ?( */}
                        <div className="Salesdashboard_1_items_list_details">
                            <div>
                                <label>Campaign</label>
                                </div>
                    <div>
                        <label>Task</label>
                        </div>
                    <div>
                        <label>Lead</label>
                        </div>
                        </div>
                   

                    {/* <div><label>Campaign</label></div>
                    <div><label>Task</label></div>
                    <div><label>Lead</label></div> */}
):(
    <></>
)}

                </div>


                <div className=" Salesdashboard_1_add">
                    <label>+</label>
                </div>



                <div className="Salesdashboard_1">
                    <div className="Salesdashboard_1_title">
                        <AiOutlineDown />
                        <label>IN Progress</label>
                    </div>
                    <div className="Salesdashboard_1_items">
                        <div className="Salesdashboard_1_items_list"></div>
                        <AiOutlineDown />
                        <label>Task names</label>
                        <BsThreeDots />
                    </div>


                    <div><label>Campaign</label></div>
                    <div><label>Task</label></div>
                    <div><label>Lead</label></div></div>


                <div className=" Salesdashboard_1_add">
                    <label>+</label>
                </div>

                <div className="Salesdashboard_1">
                    <div className="Salesdashboard_1_title">
                        <AiOutlineDown />
                        <label>Completed</label>
                    </div>
                    <div className="Salesdashboard_1_items">
                        <div className="Salesdashboard_1_items_list"></div>
                        <AiOutlineDown />
                        <label>Task names</label>
                        <BsThreeDots />
                    </div>


                    <div><label>Campaign</label></div>
                    <div><label>Task</label></div>
                    <div><label>Lead</label></div></div></div>

            <div className=" Salesdashboard_1_add">
                <label>+</label>
            </div>



            {/* </div>

                <div className=" Salesdashboard_1_add">
                    <label>+</label>
                </div>
         */}
        </>


    );
}
